import "./Footer.css";

const Footer = () => {
  return (
    <footer>
      <ul className="online_store"></ul>
      <ul className="helpful_links"></ul>
      <ul className="partners"></ul>
      <ul className="address"></ul>
    </footer>
  );
};

export default Footer;
